import React from 'react';
import './App.css'
import axios from 'axios'
import { useState } from 'react'
import { useEffect } from 'react'
export default function App() {
    const [info,setInfo]=useState([])
    useEffect(()=>{
        axios.get('https://jsonplaceholder.typicode.com/todos')
        .then((res)=>{
            setInfo(res.data)
        })
    },[])
  return (
    <div>
      <table className="table" style={{border:"1px solid red",width:"70%" }}>
        <tr style={{border:"1px solid red"}}>
            <th style={{border:"1px solid red"}}>id</th>
            <th>title</th>
            <th style={{border:"1px solid red"}}>completed</th>
        </tr>
            {info.map(user=>{
               return(
                <tr style={{border:"1px solid red"}}>
                <td style={{border:"1px solid red"}}>{user.id}</td>
                <td style={{border:"1px solid red"}}>{user.title}</td>
                <td style={{border:"1px solid red"}}>{user.completed==="false"?'0':"1"}</td>
                </tr>
               )
            }
            )}
        
      </table>
    </div>
  )
}














